package leetcode.contest.last.c159

import leetcode.contest.utils.print

fun main(args: Array<String>) {
    val s = Solution5232()
    s.balancedString("QWER").print()
    s.balancedString("QQWE").print()
    s.balancedString("QQQW").print()
    s.balancedString("QQQQ").print()
    s.balancedString("WWEQERQWQWWRWWERQWEQ").print()
    s.balancedString("WWWEQRQEWWQQQWQQQWEWEEWRRRRRWWQE").print()
    s.balancedString("").print()
    s.balancedString("").print()
}

class Solution5232 {
    fun balancedString(s: String): Int {
        println(s.length)
        val t = IntArray(4)
        val list = ArrayList<IntArray>()
        list.add(intArrayOf(0, 0, 0, 0))
        s.forEach {
            when (it) {
                'Q' -> t[0]++
                'W' -> t[1]++
                'E' -> t[2]++
                'R' -> t[3]++
            }
            list.add(t.clone())
        }
        list[0].print()
        list[list.lastIndex].print()
        val offset = IntArray(4)
        for (i in t.indices) {
            offset[i] = if (t[i] > s.length / 4) {
                t[i] - s.length / 4
            } else {
                0
            }
        }
        if (offset.sum() == 0) {
            return 0
        }

        offset.print()
        var ans = Int.MAX_VALUE
        for (i in 0 until list.size) {
            for (j in i + offset.sum() until list.size) {
//                println("$i, $j")
                if (j - i >= ans) {
                    break
                }
                if (check(list[i], list[j], offset)) {
//                    println("$j, $i")
                    ans = minOf(ans, j - i)
                }
            }
        }
        return ans
    }

    private fun check(a: IntArray, b: IntArray, offset: IntArray): Boolean {
        val c = IntArray(4)
        for (i in 0 until 4) {
            c[i] = b[i] - a[i]
        }
        for (i in 0..3) {
            if (c[i] < offset[i] && offset[i] > 0) {
                return false
            }
        }
        return true
    }
}